import React from "react";
import Meena from "./img/meena.jpg";

const Profile = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-4">
      <div className="bg-gray-900 m-3 rounded-xl h-screen p-2">
        <div className="p-4 bg-rose-300">
          <img className="w-48 h-48 rounded-full mx-auto" src={Meena} alt="" />
        </div>
      </div>
      <div className="col-span-3 m-3 rounded-xl bg-gray-200 h-screen p-2">
        Info
      </div>
    </div>
  );
};

export default Profile;
